import { useState,useEffect } from "react"

export default function Database(){
    useEffect(()=>{
        const [propertyData,setPropertyData] = useState(null);
        fetch('/query').then(res=> res.json()).then((data)=>{setPropertyData(data)})
    },[])
    return (
        <div className='db'>
            <h1>List of Properties</h1>
            {propertyData ? propertyData.map((property)=>{
                <div className='property'>
                <h1>{property.list_price}</h1>
                <h1>{property.description.beds}</h1> 
                <h1>{property.description.baths}</h1>
                <h1>{property.status}</h1>
                </div>
            }):null}
        </div>
    )
}
